import Wilaya from './Table/wilaya';
import './App.css';
import HelloWorld from './Table/helloworld';
import Navbar  from './Table/';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
function App() {
  return (
    <Router>
      <div>
        {/* <Navbar onObjectChange={handleObjectChange} /> */}
        <div className="mt-20"></div> {/* Ajout de la marge sup√©rieure */}
        <Routes>
          <Route path="/" element={<HelloWorld/>} />
          <Route path="/wilaya" element={<Wilaya />} />
        </Routes>
      </div>
    </Router>
    // <Wilaya/>

  );
}

export default App;
